INSERT INTO `discogs_artists_infos` VALUES (1,3538956,'\"Pickin\' On The Beatles\" Band','\"Pickin\' On The Beatles\" Band','An unnamed group of bluegrass musicians that recorded the \"Pickin\' On The Beatles - Vol. 1 & 2\" bluegrass tribute album.','http://api.discogs.com/artists/3538956/releases'),(2,2517607,'Beatles, The (2)','Beatles, The (2)',NULL,'http://api.discogs.com/artists/2517607/releases'),(3,510986,'Elvis Presley (2)','Elvis Presley (2)',NULL,'http://api.discogs.com/artists/510986/releases'),(4,194807,'Prince (2)','Prince (2)',NULL,'http://api.discogs.com/artists/194807/releases'),(5,389631,'Prince (3)','Prince (3)',NULL,'http://api.discogs.com/artists/389631/releases'),(6,647233,'U2 (2)','U2 (2)',NULL,'http://api.discogs.com/artists/647233/releases'),(7,1462828,'4-U-2-Know','4-U-2-Know',NULL,'http://api.discogs.com/artists/1462828/releases'),(8,125246,'Nirvana','Nirvana','Formed in 1987, Aberdeen, WA, United States. Disbanded in 1994.\r\n\r\nConsidered by many to be the leading lights of the Seattle grunge scene of the late 1980s/early 1990s, and perhaps the most influential rock band of Generations X & Y, Nirvana was a powerful trio of musicians who brought a unique aesthetic to a growing-stale rock scene.  They had already made some waves on Sub Pop with their debut, \"Bleach\".  But it wasn\'t until their major-label debut for DGC/Geffen, 1991\'s \"Nevermind\" - perhaps, more specifically, the first 30 seconds of \"Smells Like Teen Spirit\" - that they broke into the mainstream of America - not really because they wanted to. Lead singer frontman Kurt Cobain\'s death (suspected suicide) in April 1994 brought an untimely end to the band. Drummer Grohl went on to form the [a=Foo Fighters].  In the fall of 2004, \"With The Lights Out (a 3-CD/DVD set of mostly unreleased material) confirmed that interest in the band is still very high. Most young rock stars today will likely cite Nirvana as a major influence on them.\r\n','http://api.discogs.com/artists/125246/releases'),(9,307513,'Nirvana (2)','Nirvana (2)','Original 60s band, which tried to sue [a=Nirvana] in the 90s. They covered song \"Lithium\" as a tribute of sorts to Kurt Cobain.','http://api.discogs.com/artists/307513/releases'),(10,319676,'Nirvana (3)','Nirvana (3)',NULL,'http://api.discogs.com/artists/319676/releases'),(11,967565,'Madonna (2)','Madonna (2)',NULL,'http://api.discogs.com/artists/967565/releases'),(12,1973474,'Madonna (3)','Madonna (3)',NULL,'http://api.discogs.com/artists/1973474/releases'),(13,190684,'Jay-Z (2)','Jeremy Jackson','US hip-hop DJ and producer.','http://api.discogs.com/artists/190684/releases'),(14,18839,'Metallica','Metallica','Metallica is an American heavy metal band from Los Angeles, California, formed in 1981 by vocalist/guitarist James Hetfield and drummer Lars Ulrich.  The duo first met through an ad in a Los Angeles-based music newspaper.  At the time, Ulrich had little musical experience and no band but managed to secure a slot on an upcoming compilation record called “Metal Massacre”.   Metallica’s contribution, “Hit The Lights”, featured Hetfield, Ulrich and lead guitarist Lloyd Grant.  Afterwards, Ron McGovney became the band\'s bassist and Dave Mustaine joined the band as lead guitarist.  This line-up would re-record \"Hit The Lights\" for subsequent re-pressings of \"Metal Massacre\" and would also issue several demos.  In 1983, McGovney quit the group and was replaced by Cliff Burton, which also saw the band relocate to San Francisco.  Metallica then traveled to New York after signing a deal with [l=Megaforce Records].  However, once in New York, the band fired Mustaine.  It would mark the beginning of a long feud between Mustaine and Metallica, mostly fueled by remarks Mustaine would make to the press.  Mustaine was replaced by Kirk Hammett of [a=Exodus (6)].\r\n\r\nMetallica\'s debut LP, \"Kill \'Em All\", was released in 1983.  It was followed in 1984 by \"Ride The Lightning\".  This led to a major label deal with [l=Elektra].  In 1986, the band released \"Master Of Puppets\", which is considered by many to be one of the greatest heavy metal records of all time.  In September of that year, while on tour in Sweden, the band was involved in a bus accident which took the life of Cliff Burton.  Eventually, Jason Newsted (of [a=Flotsam And Jetsam]) was hired as the band\'s new bassist and he made his debut on 1987\'s \"Garage Days Re-Revisited\", an EP of cover tunes.  \r\n\r\nIn 1990, Metallica hooked up with producer [a=Bob Rock] for a self-titled release that would become better known as \"The Black Album\", due to its cover art. Released in 1991, the black album would become one of the best-selling rock albums of all time, selling over 16 million copies in the US alone.\r\n\r\nIn 1996, the band returned with \"Load\".  The following year, \"Reload\" appeared.  The albums continued the band’s trend of more accessible music.  In 1999, the group released an album and accompanying film called \"S&M\", which featured Metallica performing their songs with the San Francisco Symphony Orchestra.\r\n\r\nIn 2001, as the band was preparing to begin work on a new album, Newsted quit the group, citing personal and musical reasons.  Work on the new album was further complicated when Hetfield entered rehab for alcohol abuse.  The album, called \"St. Anger\", was eventually completed in 2003 with producer Bob Rock handling the bass.  Upon its release, \"St. Anger\" drew mostly negative reviews.  Following the recording, Robert Trujillo, formerly of [a=Suicidal Tendencies], was hired as bassist.  The making of the album was captured in the documentary “Some Kind Of Monster”.\r\n\r\nIn 2008, \"Death Magnetic\", produced by [a=Rick Rubin], would surface and was hailed by many as Metallica\'s return to thrash metal.  The following year, Metallica was inducted into Rock And Roll Hall of Fame.  Former bassist Jason Newsted was present and Cliff Burton\'s father appeared on Cliff\'s behalf.  Dave Mustaine, who was not inducted, was invited to the ceremony by the band but declined to attend.  In 2011, Metallica collaborated with [a=Lou Reed] on the album, “Lulu”, which was largely panned by critics and ignored by consumers.    \r\n','http://api.discogs.com/artists/18839/releases'),(15,362082,'Metallica (2)','Metallica (2)',NULL,'http://api.discogs.com/artists/362082/releases'),(16,2419528,'Area Metallica','Area Metallica',NULL,'http://api.discogs.com/artists/2419528/releases'),(17,124535,'Guns N\' Roses','Guns N\' Roses','American hard rock band formed in 1985 in Los Angeles, CA.\r\n\r\n[b]Current Members[/b]\r\n[i]Axl Rose[/i] [B.William Rose] (vocals, keyboards, percussion, 1985-present)\r\n[i]DJ Ashba[/i] (guitar, 2009-present)\r\n[i]Tommy Stinson[/i] (bass, 1998-present)\r\n[i]Dizzy Reed[/i] [aka Daren] (keyboards, backing vocals, drums, 1990-present)\r\n[i]Bumblefoot[/i] (guitar, 2006-present) \r\n[i]Chris Pitman[/i] (keyboards, 1999-present)\r\n[i]Richard Fortus[/i] (guitar, 2002-present)\r\n[i]Frank Ferrer[/i] (drums, 2006-present)\r\n\r\n[b]Former Members[/b]\r\n[i]Slash[/i] [Saul Hudson] (guitar, 1985-96)\r\n[i]Tracii Guns[/i] (guitar, 1985)\r\n[i]Rob Gardner[/i] (drums, 1985)\r\n[i]Steven Addler[/i] (drums, 1985-90)\r\n[i]Izzy Stradlin[/i] (rhythm guitar, acoustic guitar, backing vocals, 1985-91)\r\n[i]Duff McKagan[/i] (bass, 1985-94)\r\n[i]Matt Sorum[/i] (drums, 1990-97)\r\n[i]Gilby Clarke[/i] (rhythm guitar, 1991-94)\r\n[i]Paul H. Tobias[/i] (guitar, 1994-2002)\r\n[i]Robin Finck[/i] (guitar, 1996-99, 2000-2009)\r\n[i]Josh Freese[/i] (drums, 1998-2000)\r\n[i]Brain[/i] [Bryan Mantia] (drums, 2000-2006)\r\n[i]Buckethead[/i] [Brian Carroll] (guitar, 2000-04)\r\n[i]Krys Baratto[/i] (bass, 2000)\r\n','http://api.discogs.com/artists/124535/releases'),(18,38661,'Eminem','Marshall Bruce Mathers III','Marshall Bruce Mathers III (born October 17, 1972, Kansas City, Missouri), known by his primary stage name Eminem, or by his alter ego Slim Shady, is an American rapper and record producer who grew up in Detroit, Michigan.','http://api.discogs.com/artists/38661/releases'),(19,3710364,'Blue Ft. Elton John','Blue Ft. Elton John',NULL,'http://api.discogs.com/artists/3710364/releases'),(20,632312,'Elton John Band','Elton John Band',NULL,'http://api.discogs.com/artists/632312/releases'),(21,1289,'Daft Punk','Thomas Bangalter & Guy-Manuel de Homem-Christo','Daft Punk is a French electronic music group. The two members are [a=Thomas Bangalter] (born January 3, 1975) and [a=Guy-Manuel de Homem-Christo] (born February 8, 1974.) Bangalter and de Homem-Christo were previously in the rock band [a=Darlin\'] with [a=Laurent Brancowitz]. After Brancowitz left the group to join his brother\'s band, [a=Phoenix], the remaining duo formed Daft Punk.\r\n','http://api.discogs.com/artists/1289/releases'),(22,52835,'Beyoncé','Beyoncé Giselle Knowles','American singer, songwriter and actress, born 4 September 1981 in Houston, Texas, USA.\r\nBeyoncé rose to fame in late 1990s as the lead singer of R&B girl-group [a=Destiny\'s Child], but is now also known as successful solo artist. \r\n\r\nHer younger sister [url=http://www.discogs.com/artist/Solange+(2)]Solange Knowles[/url] is also a singer.','http://api.discogs.com/artists/52835/releases'),(23,2397871,'Beyoncé (2)','Beyoncé (2)',NULL,'http://api.discogs.com/artists/2397871/releases'),(24,65049,'Notorious B.I.G.','Christopher George Letore Wallace','Notorious \'Christopher George Letore Wallace\' B.I.G. (Business Instead of Game) was born and raised in Brooklyn, NY on May 21, 1972. During his life he moved many crowds with his conversational style in Hip Hop. He released two studio albums both garnering critical and public acclaim: \'Ready To Die\' and \'Life After Death\'. Notorious B.I.G. was shot to death from a drive-by in Los Angeles, CA on March 9, 1997.\r\n\r\nAs a youth he was an honor-roll student, but dropped out of school at the age of 17 and began working for a small-time crack cocaine dealer in Virginia. As a teen he would freestyle rap on the streets of Brooklyn. After making a demo tape with neighborhood friends and connections, this demo was eventually received DJ Mister Cee (from Big Daddy Kane). From there he got notice in Hip-Hop magazine, The Source, in the Unsigned Hype section. Sean \"Puffy\" Combs got a hold of the demo tape and after meeting signed Biggie to Uptown Records. Puffy eventually started his own music label, Bad Boy Records, bringing Biggie with him. Soon after Bad Boy\'s premiere he released the album, Ready To Die, eventually selling over 4 million copies. To this day B.I.G. is regarded as one of the best lyricist ever in Hip-Hop along with his one time friend and eventual adversary, Tupac Shakur.\r\n','http://api.discogs.com/artists/65049/releases'),(25,11213,'Wu-Tang Clan','Wu-Tang Clan','Rap group from Staten Island, New York. The nine key members are:\r\n\r\n[a=Clifford Smith (2)] AKA [a=Method Man]\r\n[a=Corey Woods] AKA [a=Raekwon]\r\n[a=Dennis Coles] AKA [a=Ghostface Killah]\r\n[a=Elgin Turner] AKA [a=Masta Killa]\r\n[a=Gary Grice] AKA [a=Genius, The] / [a=GZA]\r\n[a=Jason Hunter (2)] AKA [a=Inspectah Deck]\r\n[a=Lamont Hawkins] AKA [a=U-God]\r\n[a=Robert Diggs] AKA [a=RZA]\r\n[a=Russel Jones] AKA [a=Ol\' Dirty Bastard]\r\n\r\nOl\'Dirty Bastard passed away in 2004, so the group went down to eight members.\r\nSome may still argue [a=Cappadonna] is a member of the group, but Wu-Tang Clan was always known as \'The Nine Generals\', and that doesn\'t include him because it would bring the number of members to 10. What makes people think he is a member of Wu-Tang Clan, is the fact that he had his own photography alongside the other members\' in the booklet of the group\'s third album, \"[i]The W[/i]\". He actually rapped on two tracks of this album.\r\nThere are also a number of affiliated groups and artists, typically produced by The [a=RZA], and other Wu-Tang producers such as [a=4th Disciple], [a=True Master], and [a=Allah Mathematics].\r\n','http://api.discogs.com/artists/11213/releases'),(26,3699085,'Tom Caruana presents  Wu-Tang Clan Vs  Beatles, The','Tom Caruana presents  Wu-Tang Clan Vs  Beatles, The',NULL,'http://api.discogs.com/artists/3699085/releases'),(27,151223,'Amy Winehouse','Amy Jade Winehouse','Born September 14, 1983 - Died July 23, London, 2011\r\n\r\nWas an English jazz/soul singer and songwriter. Her debut album, Frank (released in 2003) was nominated for the Mercury Music Prize and she won an Ivor Novello award in 2004 for her debut single \"Stronger Than Me\". In 2006, she released her second album, Back to Black.\r\n\r\nFounder of [l=Lioness Records].\r\n','http://api.discogs.com/artists/151223/releases'),(28,1977760,'Mitch Winehouse','Mitch Winehouse','Father of [a=Amy Winehouse] and founder of the Amy Winehouse Foundation.','http://api.discogs.com/artists/1977760/releases'),(29,66824,'Justin Timberlake','Justin Randall Timberlake','Multiple Grammy Award-winning American pop singer and aspiring actor, born January 31, 1981 in Memphis, Tennessee. He came to fame as the frontman of pop boy band *NSYNC. In 2002, he released his debut solo album, Justified, which went on to sell over seven million copies worldwide. Timberlake\'s second solo release, FutureSex/LoveSounds, was released in 2006.','http://api.discogs.com/artists/66824/releases'),(30,2590815,'Snoop Dogg Le Malien','Snoop Dogg Le Malien',NULL,'http://api.discogs.com/artists/2590815/releases'),(31,198282,'Foo Fighters','Foo Fighters','Formed: 1995 in Seattle, WA, United States\r\n \r\nMembers: \r\nDave Grohl (vocals, guitar, bass, drums) \r\nChris Shiflett [aka Jake Jackson] (guitar, 1999-present)\r\nTaylor Hawkins (drums, 1997-present) \r\nNate Mendel (bass)\r\nGeorg Ruthenberg [aka Pat Smear] (guitar, 1995-97, 2010-present) \r\nWilliam Goldsmith (drums, 1995-97) \r\nFranz Stahl (guitar, 1997-99)\r\n','http://api.discogs.com/artists/198282/releases'),(32,2885623,'Bluegrass Tribute To Foo Fighters','Bluegrass Tribute To Foo Fighters',NULL,'http://api.discogs.com/artists/2885623/releases'),(33,100752,'2Pac','Lesane Parish Crooks aka Tupac Amaru Shakur','Born June 16. 1971 in Brooklyn, NY.\r\nDied September 13. 1996 in Las Vegas, NV, six days after being shot.\r\n\r\n[b]Main profile for his performance/stage name.[/b]\r\n','http://api.discogs.com/artists/100752/releases'),(34,774937,'2-Pac (2)','2-Pac (2)',NULL,'http://api.discogs.com/artists/774937/releases'),(35,13732,'Ice Cube','O\'Shea Jackson','Born: June 15, 1969, Los Angeles, California\r\n\r\nIce Cube began his career with the notorious gangsta rap group N.W.A. He broke away at the height of their national notoriety. On his initial solo release, 1990\'s Amerikkka\'s Most Wanted, Ice Cube injected virulent political and cultural rhetoric that stepped above N.W.A\'s gangbanging braggadocio. Ice Cube squashed the bi-coastal rap rivalry and collaborated with New York\'s hip-hop heavyweights Public Enemy. Their production team, the Bomb Squad, produced Amerikkka\'s Most Wanted. Ice Cube became a lightning rod for attracting attacks from rock critics and moralists for his lyrical content. Time has shown that the ruthless words and pointed imagery on both Amerikkka\'s Most Wanted and 1991\'s pre-LA riots Death Certificate were not included for shock-value. The message construed in his rhymes presaged Los Angeles\'s incendiary reaction to the outcome of the Rodney King trial. America was now listening to Ice Cube. Death Certificate debuted at #1 on the R&B Album chart and #2 on the Top 200 Album chart. In 1992, Ice Cube continued his vocal incursion into suburban America with a role in John Singleton\'s epic film on South Central LA, Boyz In The Hood and by touring on the second Lollapalooza. His next release, The Predator, galvanized him as the premiere multi-platinum West Coast hip-hop G. It debuted at #1 on both the R&B and Top 200 Album charts. The Predator was an epilogue to the LA riots and while \"It Was A Good Day\" provides a hassle-free moment in a Compton day, there is still dissonance in Ice Cube\'s America. 1993\'s Lethal Injection sees Ice Cube morphing into his \"Don Mega\" persona that permeates his War & Peace albums and projects with Westside Connection. These first four albums set him up for his later successes. In addition to his War & Peace two-album series, Ice Cube has recently starred in The Friday After Next, the 3rd installment of his multi-million dollar earning Friday movie franchise, Player\'s Club and the critically praised Barbershop.\r\n','http://api.discogs.com/artists/13732/releases'),(36,1308112,'Ice Cube (2)','Ice Cube (2)',NULL,'http://api.discogs.com/artists/1308112/releases'),(37,2128300,'Ice Cube (3)','Ice Cube (3)',NULL,'http://api.discogs.com/artists/2128300/releases'),(38,8024,'Janet Jackson','Janet Damita Jo Jackson','Born on the 16th May 1966 in Gary, Indiana, U.S.A.\r\nSister of [a=Michael Jackson], [a=Jermaine Jackson], [a=Jackie Jackson], [a=Tito Jackson], [a=Marlon Jackson], [a=Randy Jackson], [a=Rebbie Jackson] and [a=La Toya Jackson].\r\n','http://api.discogs.com/artists/8024/releases'),(39,15687,'Britney Spears','Britney Jean Spears','Born: December 2, 1981, McComb, Mississippi, United States.\r\nAmerican recording artist and entertainer, also known as songwriter, dancer, actress, record producer, author, fashion designer and video director.\r\n','http://api.discogs.com/artists/15687/releases'),(40,100558,'Raekwon','Corey Todd Woods','[a=Corey Woods] AKA Raekwon, born January 12, 1970 in Brooklyn, New York) is an African American rapper and a member of the [a=Wu-Tang Clan]. Though he isn\'t as commercial as other [a=Wu-Tang Clan] members, he released, in 1995, the album \"Only Built For Cuban Linx\" that was acclaimed world-wide and is considered as one of the best Wu-Tang solo albums. He is a pioneer of the Mafioso rap concept and sound.','http://api.discogs.com/artists/100558/releases'),(41,321128,'Rihanna','Robyn Rihanna Fenty','Robyn Rihanna Fenty (born February 20, 1988), known by her stage name Rihanna, is a Barbadian recording artist, actress and fashion designer. Born in Saint Michael, Barbados, she began her career as a result of meeting record producer Evan Rogers in late 2003. At age 16, she moved to the United States to pursue a recording career and began recording demo tapes under Rogers\' guidance, subsequently signing a contract with Def Jam Recordings after auditioning for Jay-Z.\r\n\r\nRihanna\'s debut studio album, Music of the Sun (2005), peaked at number ten on the Billboard 200 and features the Billboard Hot 100 top five hit single \"Pon de Replay\". Her second album, A Girl Like Me (2006), peaked at number five in the United States, and produced her first Hot 100 number one single, \"SOS\". Rihanna\'s third album, Good Girl Gone Bad (2007), spawned the international hit singles \"Umbrella\", \"Don\'t Stop the Music\", \"Take a Bow\", and \"Disturbia\". The album was nominated for nine Grammy Awards, winning Best Rap/Sung Collaboration for \"Umbrella\". Her fourth album, Rated R (2009), produced the top ten singles \"Russian Roulette\", \"Hard\", and \"Rude Boy\", with the latter achieving the number one spot on the Billboard Hot 100. Rihanna\'s fifth album, Loud (2010), spawned the number one hit singles \"Only Girl (In the World)\", \"What\'s My Name?\", and \"S&M\". Her sixth album, Talk That Talk (2011), served the worldwide chart topper \"We Found Love\" and the top five single \"Where Have You Been\". Rihanna\'s seventh album, Unapologetic (2012), was preceded by the lead single \"Diamonds\", which became Rihanna\'s twelfth number one on the Billboard Hot 100.\r\n\r\nRihanna\'s work has earned her numerous awards and accolades, including seven Grammy Awards, five American Music Awards, eighteen Billboard Music Awards and two BRIT Awards. In 2012, Rihanna was awarded by her label, Def Jam, for selling 25 million records worldwide and 75 million singles, since the beginning of her career in 2005, which makes her one of the best-selling artists of all time. She has achieved a total of twelve number one singles on the Billboard Hot 100 chart, becoming the youngest solo artist to achieve the feat. Billboard named Rihanna the Digital Songs Artist of the 2000s decade, and ranked her as the seventeenth overall artist of the same decade. In 2012, Forbes ranked her as the fourth most powerful celebrity of 2012 with earnings of $53 million between May 2011 and May 2012. The same year, American magazine Time named Rihanna one of the most influential people in the world.','http://api.discogs.com/artists/321128/releases'),(42,2343575,'Entre Rihanna','Entre Rihanna',NULL,'http://api.discogs.com/artists/2343575/releases'),(43,124541,'Bon Jovi','Bon Jovi','After one of Jon Bongiovi\'s first demos, \'Runaway,\' became a hit on the Jersey airwaves, the young musician formed the group Bon Jovi in 1983. The group went on to become one of the most successful hard rock bands of the decade, earning a huge number of fans and numerous industry honors.\r\n\r\nLineup:\r\nLead Vocals, Rhythm Guitar: [a=Jon Bon Jovi].\r\nLead Guitar,  Acoustic (6 &12 String) Guitars: [a=Richie Sambora].\r\nKeyboards: [a=David Bryan].\r\nDrums & Percussion: [a=Tico Torres].\r\n\r\nFormer Members:\r\nBass (1983-1994): [a=Alec John Such].\r\n\r\nNote: Although Hugh MacDonald occasionally plays Bass for the band he is not an official member.\r\n','http://api.discogs.com/artists/124541/releases'),(44,2356811,'Bon Jovi (2)','Bon Jovi (2)',NULL,'http://api.discogs.com/artists/2356811/releases'),(45,1065010,'Lil Wayne','Dwayne Michael Carter, Jr.','American rapper born September 27, 1982 in New Orleans, Louisiana.','http://api.discogs.com/artists/1065010/releases'),(46,432041,'Lil Wayne (2)','Lil Wayne (2)','This is NOT the Rapper Lil\' Wayne from Cash Money Records,so do not link any new Lil\' Wayne credits here...Thank You.\r\nThis is a Reggae artist.\n','http://api.discogs.com/artists/432041/releases'),(47,97139,'Usher','Usher Terrence \"Terry\" Raymond IV','Born: October 14, 1978, Dallas, Texas, U.S.\r\n\r\nUsher is an american singer-songwriter, dancer, entrepreneur and actor. He is considered around the world to be the reigning King of R&B. Usher rose to fame in the late 1990s with the release of his second album My Way, which spawned his first Billboard Hot 100 number-one hit, \"Nice and Slow\". His follow-up album, 8701, produced the Billboard Hot 100 number one hits \"U Remind Me\" and \"U Got It Bad\". Both albums sold over 8 million copies worldwide, establishing Usher as one of the best-selling R&B artists of the 1990s.\r\n\r\nUsher\'s success continued with his 2004 album Confessions, which sold over 10 million copies in the United States, and been certified diamond by the RIAA. Confessions has the highest first week sales for an R&B artist in history, and sold over 20 million copies worldwide. It spawned a record breaking four consecutive Billboard number-one hits \"Yeah!\", \"Burn\", \"Confessions Part II\", and \"My Boo\". Usher\'s 2008 album Here I Stand sold over 5 million copies worldwide, and its lead single \"Love In This Club\" peaked at number-one on the Billboard Hot 100.\r\n\r\nOn March 30, 2010, Usher released his sixth studio album Raymond v. Raymond, which became his third consecutive album to debut at number one on the US Billboard 200 chart. It has been certified platinum by the RIAA, and spawned another Billboard Hot 100 number-one hit \"OMG\". The song became his ninth number one in the United States, making him the first 2010s artist to collect number one singles in three consecutive decades, and only the fourth artist of all-time to achieve the feat. He later released an extended play and deluxe edition of \"Raymond v. Raymond\", entitled Versus, which debuted at number four on the Billboard 200 chart. Its lead single \"DJ Got Us Fallin\' In Love\", achieved international success and reached number-four on the Billboard Hot 100.\r\n\r\nThe RIAA ranks Usher as one of the best-selling artists in American music history, having sold over 23 million copies in the United States alone. To date, he has sold over 65 million records worldwide, making him one of the best selling music artists of all time. Usher, has won numerous awards including seven Grammy Awards, four World Music Awards, six American Music Awards, and twenty two Billboard Music Awards. In 2008, Usher was ranked as the 21st most successful Hot 100 Singles Artist of all-time by Billboard magazine. It also ranked Usher the number one Hot 100 artist of the 2000s decade. Naming him the second most successful overall artist of the 2000s decade, with his 2004 album Confessions being ranked as the top solo album and second most successful overall album of the last decade. In November 2010, Usher was ranked sixth by Billboard on its list of the Top 25 R&B/Hip-Hop artists of the past 25 years (1985–2010). Ranking higher than any other artist of his generation. Usher has attained nine Hot 100 number-one hits (all as a lead artist) and has attained sixteen Hot 100 top-ten hits. Aside from his musical career, he is regarded as a sex symbol. In 1998 People named him the sexiest R&B artist alive. In 2010, Glamour named him one of the 50 sexiest men alive.\r\n','http://api.discogs.com/artists/97139/releases'),(48,546961,'Usher (2)','Michel Lecamp','Electronic music producer.\r\n','http://api.discogs.com/artists/546961/releases'),(49,748553,'Usher (3)','Usher (3)',NULL,'http://api.discogs.com/artists/748553/releases'),(50,17590,'Youssou N\'Dour','Youssou N\'Dour','Youssou n\'Dour was born in Dakar in 1959 and began singing as a child performer at neighborhood gatherings in the tough Medina section of Dakar, Senegal, West Africa. He took formally to the stage at age 12 and by his mid-teens was singing regularly with the Star Band, the most successful group in Senegal at that time. In 1979, he formed his own ensemble, the Etoile de Dakar, which, by 1981, had evolved into The Super Etoile. The most famous band in Africa, The Super Etoile, guided by Youssou N\'Dour has crafted and invented a thoroughly modern African pop style, one which has gone on to influence artists as diverse as Peter Gabriel and Paul Simon. \r\n\r\nIt was Gabriel, in fact, who introduced N\'Dour to American and British artists via his So album (in 1986) and took N\'Dour and The Super Etoile on the road with him in a subsequent world tour. In 1988, Youssou N\'Dour was a co-headliner on the Amnesty International \"Human Rights Now!\" tour alongside Gabriel, Bruce Springsteen, Sting, and Tracy Chapman. It was during the \"Human Rights Now!\" tour that N\'Dour first heard Chimes Of Freedom and became friends with Branford Marsalis, who appears on The Guide.\r\n\r\nN\'Dour\'s first international album releases on Virgin, The Lion (1989), produced by George Acogny and containing the N\'Dour-Gabriel composed single \"Shaking The Tree\"; and Set (1990), produced by Brian Eno-compadre Michael Brook, prompted Brian Cullman to write in Rolling Stone: \"If any third world performer has a real shot at the sort of universal popularity last enjoyed by Bob Marley, it\'s Youssou, a singer with a voice so extraordinary that the history of Africa seems locked inside it.\" \r\n\r\nIn the summer of 1991, Youssou N\'Dour signed to Spike Lee\'s 40 Acres & A Mule Musicworks label, distributed by Columbia. N\'Dour was impressed by Lee\'s stated commitment to \"enlarging the legacy of great African-American music\" in a wide range of styles and Lee\'s belief that N\'Dour\'s music constituted a part of that legacy. The result of that union was 1992\'s Eyes Open; self-produced by N\'Dour at his own state-of-the-art Xippi Studio in Dakar and featuring The Super Etoile, Eyes Open went on to win a Grammy Award nomination. \r\n\r\nSince the release of Eyes Open, Youssou N\'Dour was made an ambassador for UNICEF in conjunction with the Year Of The Child. In July 1993, an African opera composed by N\'Dour premiered at the Paris Opera. N\'Dour was the subject of a recent episode of the BBC\'s Rhythms Of The World program.\r\n','http://api.discogs.com/artists/17590/releases'),(51,3600230,'Youssou\'N Dour','Youssou\'N Dour',NULL,'http://api.discogs.com/artists/3600230/releases'),(52,2801785,'Anusified By Youssou N\'Dour','Anusified By Youssou N\'Dour',NULL,'http://api.discogs.com/artists/2801785/releases'),(53,1003,'Muse','Mathew Ballamy, Chris Wolstenholme, Dominic Howard','UK alternative rock band, formed in Teignmouth/Devon in 1994.','http://api.discogs.com/artists/1003/releases'),(54,158246,'Muse (2)','Muse (2)',NULL,'http://api.discogs.com/artists/158246/releases'),(55,210498,'Muse (3)','Muse (3)',NULL,'http://api.discogs.com/artists/210498/releases'),(56,431838,'Adele (2)','Adele (2)',NULL,'http://api.discogs.com/artists/431838/releases'),(57,819015,'Adele (3)','Adele Laurie Blue Adkins','Born 5 May 1988 in Tottenham, North London. Adele (Adkins) is an English Soul/Jazz singer from West Norwood in South London.\r\n\r\nShe signed to [url=http://www.discogs.com/label/XL+Recordings]XL Recordings[/url] for the release of her second single and subsequent debut album.\r\n(Her debut single having been released as a 500 Limited Edition 7\" on [url=http://www.discogs.com/label/Pacemaker+Recordings]Pacemaker Recordings[/url].)\r\n\r\nShe plays guitar and piano, though her music is characterised by her soulful voice which has been described as [i]\"somewhere between [url=http://www.discogs.com/artist/Dusty+Springfield]Dusty Springfield[/url] and [url=http://www.discogs.com/artist/Jill+Scott]Jill Scott[/url].\"[/i] (In contrast to the hard South London accent of her spoken voice). She confesses to being obsessed with the themes of love lost and heartbreak which, along with teenage experiences and London life, predominate in her soul-tinged songs.\r\n\r\nOctober 2007 saw her first headlining tour (in the UK), after previously touring with best friend [url=http://www.discogs.com/artist/Jack+Pe%C3%B1ate]Jack Peñate[/url] (on whose album [url=http://www.discogs.com/release/1101920]Matinée[/url] she provides backing vocals for [i]My Yvonne[/i]), as well supporting [url=http://www.discogs.com/artist/Jamie+T]Jamie T[/url], [url=http://www.discogs.com/artist/Raul+Mid%C3%B3n]Raul Midon[/url], [url=http://www.discogs.com/artist/Devendra+Banhart]Devendra Banhart[/url] and [url=http://www.discogs.com/artist/Amos+Lee]Amos Lee[/url].\r\n\r\nShe lists [url=http://www.discogs.com/artist/Etta+James]Etta James[/url], [url=http://www.discogs.com/artist/Jill+Scott]Jill Scott[/url], [url=http://www.discogs.com/artist/Billy+Bragg]Billy Bragg[/url], [url=http://www.discogs.com/artist/Peggy+Lee]Peggy Lee[/url], [url=http://www.discogs.com/artist/Jeff+Buckley]Jeff Buckley[/url], [url=http://www.discogs.com/artist/Ella+Fitzgerald]Ella Fitzgerald[/url], [url=http://www.discogs.com/artist/Billie+Holiday]Billie Holiday[/url], [url=http://www.discogs.com/artist/Johnny+Cash]Johnny Cash[/url] and [url=http://www.discogs.com/artist/Cure%2C+The]The Cure[/url] amongst her influences, and is also a huge fan of Al Pacino.','http://api.discogs.com/artists/819015/releases'),(58,79578,'50 Cent','Curtis James Jackson III','Curtis James Jackson III (born July 6, 1975), better known by his stage name 50 Cent, is an American rapper. He rose to fame with the release of his albums Get Rich or Die Tryin\' (2003) and The Massacre (2005). Both albums achieved multi-platinum success, selling over eleven million copies combined.\r\n\r\nBorn in South Jamaica, Queens, 50 Cent began drug dealing at the age of twelve during the 1980s crack epidemic. After leaving drug dealing to pursue a rap career, he was shot nine times in 2000. After releasing his album Guess Who\'s Back? in 2002, 50 Cent was discovered by rapper [a=Eminem] and signed to [l=Interscope Records]. With the help of Eminem and [a=Dr. Dre] — who produced his first major commercial successes — he became one of the world\'s highest selling rappers. In 2003, he founded the record label G-Unit Records, which signed several successful rappers such as [a=Young Buck], [a=Lloyd Banks], and [a=Tony Yayo].\r\n\r\n50 Cent has engaged in feuds with other rappers including [a=Ja Rule], [url=http://www.discogs.com/artist/Game%2C+The+(2)]The Game[/url], [a=Fat Joe] and most recently [a=Rick Ross]. He has also pursued an acting career, appearing in the semi-autobiographical film Get Rich or Die Tryin\' in 2005, the Iraq War film Home of the Brave in 2006, and Righteous Kill in 2008.','http://api.discogs.com/artists/79578/releases'),(59,1460031,'50 Cent Haircut','50 Cent Haircut',NULL,'http://api.discogs.com/artists/1460031/releases'),(60,57770,'Cee-Lo','Thomas DeCarlo Callaway','Rapper and singer from the Atlanta-based [a=Goodie Mob], now more known for his work with the chart-topping [a=Gnarls Barkley].\r\nReleased his first solo album \'Cee-Lo Green And His Perfect Imperfections\' on Arista in 2002 to much critical acclaim.\r\nCeeLo has one of the most distinctive voices in all of hip-hop.\r\n','http://api.discogs.com/artists/57770/releases'),(61,423977,'Cee-Lo Green','Cee-Lo Green','<b>Please do not use. Use [a57770].</b>','http://api.discogs.com/artists/423977/releases'),(62,3576984,'Jazze Pha & Cee-Lo Green','Jazze Pha & Cee-Lo Green',NULL,'http://api.discogs.com/artists/3576984/releases'),(63,323383,'R Kelly','R Kelly',NULL,'http://api.discogs.com/artists/323383/releases'),(64,2928177,'R. Kelly (2)','R. Kelly (2)',NULL,'http://api.discogs.com/artists/2928177/releases'),(65,38905,'Alicia Keys','Alicia Augello Cook','Alicia Augello Cook (born January 25, 1981 in Manhattan, New York, U.S.A.), better known by her stage name Alicia Keys, is an American recording artist, musician and actress. She was raised by a single mother in the Hell\'s Kitchen area of Manhattan in New York City. At age seven, Keys began to play classical music on the piano. She attended Professional Performing Arts School and graduated at 16 as valedictorian. She later attended Columbia University before dropping out to pursue her music career. Keys released her debut album with J Records, having had previous record deals first with Columbia and then Arista Records.\r\n\r\nKeys\' debut album, Songs in A Minor, was a commercial success, selling over 12 million copies worldwide. She became the best-selling new artist and best-selling R&B artist of 2001. The album earned Keys five Grammy Awards in 2002, including Best New Artist and Song of the Year for \"Fallin\'\". Her second studio album, The Diary of Alicia Keys, was released in 2003 and was also another success worldwide, selling eight million copies. The album garnered her an additional four Grammy Awards in 2005. Later that year, she released her first live album, Unplugged, which debuted at number one in the United States. She became the first female to have an MTV Unplugged album to debut at number one and the highest since Nirvana in 1994.\r\n\r\nKeys made guest appearances on several television series in the following years, beginning with Charmed. She made her film debut in Smokin\' Aces and went on to appear in The Nanny Diaries in 2007. Her third studio album, As I Am, was released in the same year and sold six million copies worldwide, earning Keys an additional three Grammy Awards. The following year, she appeared in The Secret Life of Bees, which earned her a nomination at the NAACP Image Awards. She released her fourth album, The Element of Freedom, in December 2009, which became Keys\' first chart-topping album in the United Kingdom. Throughout her career, Keys has won numerous awards and has sold over 30 million albums worldwide. Billboard magazine named her the top R&B artist of the 2000–2009 decade, establishing herself as one of the best-selling artists of her time.\r\n','http://api.discogs.com/artists/38905/releases'),(66,424476,'Band Of Horses','Band Of Horses','Band of Horses, originally briefly known as Horses, is an American rock band formed in 2004 in Seattle by Ben Bridwell.\r\n\r\nYears active: 2004 – present\r\n','http://api.discogs.com/artists/424476/releases'),(67,3710391,'Horses (3)','Horses (3)','Belgian indie rock / folk rock band.','http://api.discogs.com/artists/3710391/releases'),(68,2788711,'Balkan Horses Band','Balkan Horses Band',NULL,'http://api.discogs.com/artists/2788711/releases');
